import React from 'react';
import About from './About';
import Reviews from './Reviews';
import Photos from './Photos';
import { Label, Menu, Tab } from 'semantic-ui-react';

const ShowMenu = ({ favorite, rate, doctor, reviews, photos }) => {
  const panes = [
    {
      menuItem: { key: 'about', icon: 'user', content: 'About' },
      render: () => (
        <Tab.Pane>
          <About favorite={favorite} rate={rate} doctor={doctor} />
        </Tab.Pane>
      ),
    },
    {
      menuItem: {label: `${reviews && reviews.length}`, key: 'reviews', icon: 'edit', content: 'Reviews' },
      render: () => (
        <Tab.Pane>
          <Reviews reviews={reviews} />
        </Tab.Pane>
      ),
    },
    {
      menuItem: (
        <Menu.Item key='photos' icon='image' content='Photos'>
          <Label>{photos && photos.length}</Label>
        </Menu.Item>
      ),
      render: () => (
        <Tab.Pane>
          <Photos photos={photos} />
        </Tab.Pane>
      ),
    },
  ];
  return <Tab panes={panes} />;
};

export default ShowMenu;
